import React from 'react';
import styled from 'styled-components';
import { Form, Input, Button } from '../styled/theme';
const AuthStyle = styled.div`
    margin-top: 10vh;
    margin-bottom: 10vh;
    margin-left: 20vw;
    margin-right: 20vw;
`;
const Login = () => {
	return(
		<AuthStyle>
			<h3>Login</h3>
			<Form>
				<Input type="email" />

			</Form>
		</AuthStyle> 
	);
};

export default Login;
